import React from 'react'
import './styles.scss';

import Wave from '../../assets/wave1.svg';

const Home = () => {
  return (
    <> 
      <div className="container">
        <img src={Wave} alt="wave" />
      </div>
    </>
    
  )
}
export default Home;
